43X)"]},{"cell_type":"markdown","id":"ac901961","metadata":{"papermill":{"duration":0.006282,"end_time":"2024-03-14T06:59:57.209676","exception":false,"start_time":"2024-03-14T06:59:57.203394","status":"completed"},"tags":[]},"source":["# Sentiments"]},{"cell_type":"markdown","id":"0024b694","metadata":{"papermill":{"duration":0.006357,"end_time":"2024-03-14T06:59:57.223318","exception":false,"start_time":"2024-03-14T06:59:57.216961","status":"completed"},"tags":[]},"source":["## We can retrieve these lexicons using the get_sentiments() function. We can implement this as follows:"]},{"cell_type":"code","execution_count":4,"id":"7633e732","metadata":{"execution":{"iopub.execute_input":"2024-03-14T06:59:57.240089Z","iopub.status.busy":"2024-03-14T06:59:57.238239Z","iopub.status.idle":"2024-03-14T06:59:57.308797Z","shell.execute_reply":"2024-03-14T06:59:57.306353Z"},"papermill":{"duration":0.081487,"end_time":"2024-03-14T06:59:57.311174","exception":false,"start_time":"2024-03-14T06:59:57.229687","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A tibble: 6786 × 2</caption>\n","<thead>\n","\t<tr><th scope=col>word</th><th scope=col>sentiment</th></tr>\n","\t<tr><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;chr&gt;</th></tr>\n","</thead>\n","<tbody>\n","\t<tr><td>2-faces      </td><td>negative</td></tr>\n","\t<tr><td>abnormal     </td><td>negative</td></tr>\n","\t<tr><td>abolish      </td><td>negative</td></tr>\n","\t<tr><td>abominable   </td><td>negative</td></tr>\n","\t<tr><td>abominably   </td><td>negative</td></tr>\n","\t<tr><td>abominate    </td><td>negative</td></tr>\n","\t<tr><td>abomination  </td><td>negative</td></tr>\n","\t<tr><td>abort        </td><td>negative</td></tr>\n","\t<tr><td>aborted      </td><td>negative</td></tr>\n","\t<tr><td>aborts       </td><td>negative</td></tr>\n","\t<tr><td>abound       </td><td>positive</td></tr>\n","\t<tr><td>abounds      </td><td>positive</td></tr>\n","\t<tr><td>